$('.amq #query').click(function() {
	$('.modal-content').html("<div class=\"row query\"><div class=\"col-xs-12\"><div class=\"title\">查询条件</div><div class=\"content row\"><span id=\"add\" class=\"glyphicon glyphicon-plus\" title=\"增加一个条件\"></span></div><hr><button id=\"submit\" class=\"btn btn-default\" data-dismiss=\"modal\">提交</button><div id=\"tip\">条件为空时，点击提交查询所有数据，或点击上方的 <span class=\"glyphicon glyphicon-plus\"></span> 图标设置查询条件</div></div></div>");
});
$(document).on('click','.modal-content .query #add',function() {
	$(this).before("<div id=\"condition\" class=\"input-group\"><select id=\"index\"><option>学院</option><option>专业</option><option>班级</option><option>学号</option><option>姓名</option><option>性别</option><option>生源地省</option><option>生源地市</option><option>生源地区</option><option>学历</option><option>毕业时间</option><option>工作省份</option><option>工作市</option><option>工作地区</option><option>工作单位</option><option>职务</option><option>职称</option><option>行业</option><option>联系电话</option><option>固定电话</option><option>邮箱</option><option>QQ号</option><option>通讯地址</option><option>邮编</option><option>备注</option><option>所属校友总会</option><option>校友总会职务</option><option>所属校友分会</option><option>校友分会职务</option></select><select id=\"eq\"><option>=</option><option>!=</option><option>like</option></select><input><span id=\"del\" class=\"glyphicon glyphicon-remove\" title=\"删除本行条件\"></span></div>");
});
$(document).on('click', '.modal-content .query #del', function() {
	$(this).parent().remove();
});
$(document).on('click', '.modal-content .query #submit', function() {
	var obj = $('.content #condition').first();
	var qs = "";
	var s = "";
	while (true) {
		if (obj.find("#index").length > 0) {
			k=colModelNames[parseInt(obj.find("#index option:selected").index())+1];
			switch (parseInt(obj.find("#eq option:selected").index())) {
				case 0:
					v = " = '" + obj.find("input").val() + "'";
					break;
				case 1:
					v = " != '" + obj.find("input").val() + "'";
					break;
				case 2:
					v = " LIKE '%" + obj.find("input").val() + "%'";
					break;
			}
			s += obj.find("#index").val() + " " + obj.find("#eq").val() + " '" + obj.find("input").val() + "' ";
			if(qs!="")
				qs+=" & ";
			qs += k + v;
		} else
			break;
		obj = obj.next();
	}
	if (qs == "") {s = "全部";qs = "all";}
	$('#show').html("查询条件:" + s);
	$("#gridTable").jqGrid("setGridParam", {
		datatype : 'json', postData : {'val' : qs},
	}).trigger("reloadGrid");
});
/**
 * 字段控制
 */
$('.amq #col-ctrl').click(function() {
	obj = $('#gridTable_id');
	var show = new Array();
	while (obj.length > 0) {
		if (obj.css('display') == "none")
			show.push(0);
		else
			show.push(1);
		obj = obj.next();
	}
	var html = "<div class=\"row show\"><div class=\"col-xs-12\"><div class=\"title\">字段显示</div><div class=\"content row\">";
	for (var i = 0; i < colModelNames.length; i++) {
		html += "<div class=\"col-xs-3\"><input type=\"checkbox\" id=\"ci-" + i + "\" ";
		if (show[i] == "1")
			html += "checked";
		html += "><label id=\"cb_" + colModelNames[i] + "\" for=\"ci-" + i + "\">" + colNames[i] + "</label></div>";
	}
	html += "</div><hr><button id=\"submit\" class=\"btn btn-default\" data-dismiss=\"modal\">提交</button><div id=\"tip\">未选择的列名，表格中将不显示</div></div></div>";
	$('.modal-content').html(html);
});
$(document).on('click', '.modal-content .show #submit', function() {
	var hide = new Array();
	var show = new Array();
	for (var i = 0; i < colModelNames.length; i++) {
		var w_status = $("#ci-" + i).is(':checked');
		var n_status;
		if ($("#gridTable_" + colModelNames[i]).css('display') == "none")
			n_status = false;
		else
			n_status = true;
		if (w_status != n_status) {
			if (w_status == true)
				show.push(colModelNames[i]);
			else
				hide.push(colModelNames[i]);
		}
	}
	$('#gridTable').hideCol(hide).trigger('reloadGrid');
	$('#gridTable').showCol(show).trigger('reloadGrid');
});
