/**
 * 增删改
 */
$("#addInfo").click(function() {
	$("#gridTable").jqGrid('editGridRow', "new", {
		height : 700,
		width : 700,
		addCaption : "编辑记录",
		recreateForm : true,
		closeAfterAdd : true
	});
});
$("#delInfo").click(function() {
	var selectedRowIds = $("#gridTable").jqGrid("getGridParam", "selarrrow");
	var len = selectedRowIds.length;
	if (len == 0) {
		alert("请勾选要删除的数据行");
	} else {
		if(confirm("确认删除勾选的数据行？")==true){
			for (var i = 0; i < len; i++) {
				$("#gridTable").jqGrid("delRowData", selectedRowIds[0]);
			}
		}
	}
});
$("#altInfo").click(function() {
	var ids = $("#gridTable").jqGrid('getGridParam', 'selarrrow');
	if (ids.length == 0) {
		alert("请勾选要编辑的数据行");
	} else if (ids.length > 1) {
		alert("一次只能编辑一行数据");
	} else {
		$("#gridTable").jqGrid('editGridRow', ids[0], {
			onclickSubmit : function() {

			}
		});
	}
});
